// JavaScript Document

import React, { Component } from 'react';


function Header() {
  return (
    <header>
	  <div className="logo">Logo</div>

	  <nav>
	  	<ul>
	  		<li className="first"><a href="/">Home</a></li>
	  		<li><a href="/">Art</a></li>
	  		<li className="last"><a href="/">Contact</a></li>
	  	</ul>

	  </nav>

    </header>
  );
}

export default Header;
